SET SQL_SAFE_UPDATES = 0;
SET FOREIGN_KEY_CHECKS=0;
DELETE FROM item_model WHERE 1=1;
DELETE FROM item_type WHERE 1=1;
DELETE FROM item WHERE 1=1;
SET FOREIGN_KEY_CHECKS=1;










SELECT m.model_name, t.type_name, c.category_name, count(m.model_name) "Item Count"
FROM item i 
JOIN item_model m ON i.item_model_id = m.item_model_id
JOIN item_type t ON i.item_type_id = t.item_type_id
JOIN item_category c ON i.item_category_id = c.item_category_id
GROUP BY m.model_name, t.type_name, c.category_name
ORDER BY 4 DESC, 3, 2, 1 ASC;
